import React from "react"

import "./InputComponent.scss"

export const InputComponent = (props) => {
    return (
        <div className={`inputComponent ${props.className}`}>
            <div className="inputComponentIcon">{props.icon}</div>
            <input ref={props.ref} onBlur={props.onBlur} type={props.type} placeholder={props.placeholder} value={props.value} onChange={props.onChange} />
        </div>
    )
}
